import Navbar from "./Components/Navbar";
import React from "react";
import { Route,Routes } from "react-router";
import Home from "./routes/Home";

function App() {
  return (
    <div className="App">
      <Routes>
        <Route element/>
      </Routes>
      <Navbar/>
      <Home/>
    </div>
  );
}

export default App;
